window.bookSummaryJSON = "<p><b>A new ship. A new crew. A different kind of mission.</b></p> <p>When Manchester Yards donates a new training vessel to the Merchant Officer Academy at Port Newmar, Alys Giggone recalls the&nbsp;<i>Chernyakova.</i></p> <p>She wants Ishmael Wang and his crew to take a crew of cadets into the Deep Dark. They have to sort out the crews of two ships, figure out what lessons they need to teach, and who will get those lessons.</p> <p>Once they agree, the trouble starts.</p>"; 
